  [],\n\t\"revision_timestamp\": \"2015-05-07T03:55:40.277388\",\n\t\"name\": \"flight-lossless-data-compression-electronics-project-a9832\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"AbstractrnrnThere is a valid scientific
  data paradigm where no loss of data can be tolerated.  However, transmission of
  raw data requires unacceptable bandwidth and storage resources such that the net
  data received is uncomfortably low.  Lossless data compression can be used to preserve
  all data with no information loss and also help meet bandwidth and storage constraints.
  \ The current Universal Source Encoder of Space (USES) has been meeting many lossless
  compression needs for a decade.  However, USES is not able to successfully address
  higher speed instruments, beyond 20 MSamples/sec, or function at quantization levels
  higher than 15 bits.  The proposed work provides a new solution and presents a lossless
  data solution that should be valid for at least a decade or more. rnrnA radiation
  tolerant high performance (100M Samples/second) 32-bit lossless custom processor
  will be delivered in the proposed work which meets the CCSDS 121-0-B 1 recommendation.
  \ The processor will be implemented in a radiation tolerant 0.25 micron CMOS process
  which realizes a proven algorithm developed at GSFC and implemented in a 15-bit
  version 10 years ago.  The new compressor is 5 times faster and has twice the input
  quantization range, suitable for modern spacecraft requirements.   The net-list
  (design) of the processor can be used to synthesize a future 200 Msamples/sec plus
  data rates when a sub-100 nm radiation tolerant fabrication process is available.
